import React from "react";
import { useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();
  return (
    <nav className="bg-blue-900 text-white px-8 py-4 flex justify-between items-center fixed w-full z-30">
      <h1 className="text-xl font-bold">Bharat Internship</h1>
      <div className="space-x-6">
        <button onClick={() => navigate("/")} className="hover:text-gray-300">Home</button>
        <button onClick={() => navigate("/find")} className="hover:text-gray-300">Find Internships</button>
        <button onClick={() => navigate("/industries")} className="hover:text-gray-300">For Industries</button>
        <button onClick={() => navigate("/login")} className="bg-white text-blue-900 px-4 py-2 rounded">Login</button>
      </div>
    </nav>
  );
};

export default Navbar;
